      SELECT col0 / + col0 FROM tab2 WHERE + col2 NOT IN ( + col1, - ( - - 67 ) + col2 * - 30 * + col2 / + + col2 );
  - name: tab2

outputs:
  - name: q9667.out
    data: |
      1
      1
      1
